// export function svgWithColor(svg, color) {
//   return SVG[svg].replace(/fill="[^"]*"/g, `fill="${color}"`);
// }
export function svgWithColor(svg, fillColor, strokeColor) {
  let modifiedSVG = SVG[svg];

  if (fillColor) {
    // Replace fill attribute with the specified color
    modifiedSVG = modifiedSVG.replace(/fill="[^"]*"/g, `fill="${fillColor}"`);
  }

  if (strokeColor) {
    // Replace stroke attribute with the specified color
    modifiedSVG = modifiedSVG.replace(
      /stroke="[^"]*"/g,
      `stroke="${strokeColor}"`,
    );
  }

  return modifiedSVG;
}
